script: |
  super -f text -I q12678.spq | sort > q12678.out

inputs:
  - name: q12678.spq
    data: |
      SELECT + 3 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - CAST ( NULL AS INTEGER ) * - - col1 * + - col1 + col1 BETWEEN + 39 AND NULL;
  - name: tab2

outputs:
  - name: q12678.out
    data: |
